export function PostData(type, userdata){
    let BaseUrl = '';

    return new Promise((resolve, reject) => {
        fetch(BaseUrl + type,{
            method: 'POST',
            body: JSON.stringify(userdata)
        })
        .then((response) => response.json())
        .then((responseJson) => {
            resolve(responseJson);
        })
        .catch((error) => {
            reject(error);
        });
    });
}
